select
    fu.Id
    ,fu.Lastname + ' ' + fu.Firstname + isnull(' ' + fu.Fathername, '') as "ФИО"
    ,N'МФК "Лайм-Займ" (ООО)' as "Первоначальный кредитор"
    ,c.DogovorNumber as "Номер договора займа"
    ,cast(c.DateStarted as date) as "Дата договора"
    ,dateadd(d, c.Period, c.DateStarted) as "Дата возврата займа по договору"
    ,c.DatePaid as "Фактическая дата гашения займа"
    ,datediff(d, ca.overduestart, getdate()) + 1 as "Дней просрочки"
    ,mw.Description as "Канал выдачи займа"
    ,null as "Дата гашения займа"
    ,c.Amount as "Сумма займа по договору"
    ,cb.Amount as "Остаток тела долга"
    ,c.Period as "Срок займа, дней"
    ,c."Percent" as "Ставка процентов"
    ,cb.PercentAmount + cp.percentAmount as "Всего начислено процентов"
    ,cb.PercentAmount as "Остаток процентов"
    ,cb.CommisionAmount + cp.commissiion as "Всего начислено комиссии"
    ,cb.CommisionAmount as "Остаток комиссии"
    ,cb.PenaltyAmount + cp.penalty as "Всего начислено штрафов"
    ,cb.PenaltyAmount as "Штраф"
    ,cb.LongPrice + cp.long as "Всего начислено продлений"
    ,cb.LongPrice as "Продления"
    ,cb.TransactionCosts + cp.ti as "Всего начислено ТИ"
    ,cb.TransactionCosts as "ТИ"
    ,cp.amount + cp.percentAmount + cp.commissiion + cp.penalty + cp.long + cp.ti as "Оплачено"
    ,c.SmsCode as "Ключ электронной подписи"
    ,concat(uar.CityName
            ,isnull(', ' + uar.StreetName, '')
            ,N', д. ', uar.House
            ,isnull(N', к. ' + uar.Block, '')) as "Адрес регистрации"
    ,concat(uaf.CityName
            ,isnull(', ' + uaf.StreetName, '')
            ,N', д. ', uaf.House
            ,isnull(N', к. ' + uaf.Block, '')) as "Адрес фактического места жительства"
    ,uc.Passport as "Серия и номер паспорта"
    ,uc.PassportIssuedOn as "Дата выдачи паспорта"
    ,uc.PassportIssuedBy as "Кем выдан паспорт"
    ,uc.Birthday as "Дата рождения заёмщика"
    ,uc.BirthPlace as "Место рождения зхаёмщика"
    ,case when uc.Gender = 1 then N'М' else N'Ж' end as "Пол заёмщика"
    ,datediff(d, uc.Birthday, getdate()) / 365 as "Возраст заёмщика"
    ,fu.MobilePhone as "Мобильный телефон"
    ,uc.OrganizationName as "Место работы"
    ,coalesce(uc.Position, N'Сотрудник по найму') as "Должность"
    ,uc.Income as "Ежемесячный доход"
from dbo.Credits c
inner join dbo.FrontendUsers fu on fu.Id = c.UserId
inner join dbo.EnumDescriptions mw on mw.Value = c.Way
    and mw.Name = 'MoneyWay'
left join dbo.tf_getcollectorassigns(getdate(), getdate(), 0) ca on ca.creditid = c.id
left join dbo.UserCards uc on uc.UserId = c.UserId
left join dbo.UserAddresses uar on uar.Id = uc.RegAddressId
left join dbo.UserAddresses uaf on uaf.Id = uc.FactAddressId
outer apply
(
    select top 1 
        Amount
        ,PercentAmount
        ,CommisionAmount
        ,PenaltyAmount
        ,LongPrice
        ,TransactionCosts
    from dbo.CreditBalances cb
    where cb.creditid = c.id
    order by date desc
) cb
outer apply
(
    select
        isnull(sum(Amount), 0) as amount
        ,isnull(sum(PercentAmount), 0) as percentAmount
        ,isnull(sum(CommissionAmount), 0) as commissiion
        ,isnull(sum(PenaltyAmount), 0) as penalty
        ,isnull(sum(LongPrice), 0) as long
        ,isnull(sum(TransactionCosts), 0) as ti
    from dbo.CreditPayments cp
    where cp.creditid = c.id
) cp
where c.Status != 8
